import React from 'react';
import {
  Container,
  Row,
  Col } from 'reactstrap';

import "../App.css"

const NavigationBottom = (props) => {
  return (
  <div className="box">
   <Container>
      <Row>
        <Col>.col</Col>
        <Col>.col</Col>
        <Col>.col</Col>
        <Col>.col</Col>
     </Row>
  </Container>
  </div>
  );
};

export default NavigationBottom ;
